import cv2
import numpy as np
import matplotlib.pyplot as plt

# Load the X-ray image
image = cv2.imread('Scanerio 01.png', cv2.IMREAD_GRAYSCALE)

plt.imshow(image, cmap="gray")

"""![image.png](data:image/png;base64,)"""

median_blur = cv2.medianBlur(image, 7)


plt.subplot(1,2,1)
plt.imshow(image, cmap='gray')
plt.axis('off')
plt.title('Original')

plt.subplot(1,2,2)
plt.imshow(median_blur, cmap='gray')
plt.axis('off')
plt.title('Median Filtered')
plt.show()

"""# Task 2: Enhance edges and highlight fractures.

![image.png](data:image/png;base64,)
"""

# Apply Laplacian Filter for edge detection
laplacian = cv2.Laplacian(median_blur, cv2.CV_64F, ksize=11)


plt.imshow(laplacian, cmap='gray')
plt.title('Laplacian Filter')
plt.show()

"""### Scenario 02: Object Detection in Autonomous Vehicles

![image.png](data:image/png;base64,)

#### Task 1: Smooth the image and remove unnecessary details.
"""

# Load the road image
image = cv2.imread('Scanerio 02 (1).png',cv2.IMREAD_GRAYSCALE)
plt.imshow(image, cmap="gray" )

"""![image.png](data:image/png;base64,)"""

smoothed_image = cv2.GaussianBlur(image, (25,25), 10)

# Display the results
plt.subplot(1, 2, 1)
plt.imshow(cv2.cvtColor(image, cv2.COLOR_BGR2RGB))
plt.axis('off')
plt.title('Original')

plt.subplot(1, 2, 2)
plt.imshow(cv2.cvtColor(smoothed_image, cv2.COLOR_BGR2RGB))
plt.axis('off')
plt.title('Gaussian Blurred')
plt.show()

"""#Task 2: Detect Edges for lane markings and road boundaries.

![image.png](data:image/png;base64,)
"""

laplacian = cv2.Laplacian(smoothed_image, cv2.CV_64F, ksize=5)

# Display results
plt.imshow(laplacian, cmap='gray')
plt.axis('off')
plt.title('Laplacian Edge Detection')
plt.show()

"""#Task 3: Reduce noise while preserving edges for object detection.

![image.png](data:image/png;base64,)

![image.png](data:image/png;base64,)
"""

road_denoised = cv2.bilateralFilter(image, 9, 150, 150)

# Display the results
plt.subplot(1, 2, 1)
plt.imshow(cv2.cvtColor(image, cv2.COLOR_BGR2RGB))
plt.axis('off')
plt.title('Original')

plt.subplot(1, 2, 2)
plt.imshow(cv2.cvtColor(road_denoised, cv2.COLOR_BGR2RGB))
plt.axis('off')
plt.title('Denoised Image')
plt.show()

"""![image.png](data:image/png;base64,)"""

old_photo = cv2.imread('Scanerio 03 (2).png', cv2.IMREAD_GRAYSCALE)
plt.imshow(old_photo,cmap='gray')

"""#Task 1. Reduce general noise and smooth the image

![image.png](data:image/png;base64,)
"""

old_photo_smoothed = cv2.blur(old_photo, (5,5))

# Display the results
plt.subplot(1, 2, 1)
plt.imshow(cv2.cvtColor(old_photo, cv2.COLOR_BGR2RGB))
plt.axis('off')
plt.title('Original')

plt.subplot(1, 2, 2)
plt.imshow(cv2.cvtColor(old_photo_smoothed, cv2.COLOR_BGR2RGB))
plt.axis('off')
plt.title('Mean Blurred Image')
plt.show()

"""#Task 2. Remove fine-grain noise while maintaining clarity.

![image.png](data:image/png;base64,)
"""

old_photo_denoised = cv2.medianBlur(old_photo, 5)

# Display the results
plt.subplot(1, 2, 1)
plt.imshow(cv2.cvtColor(old_photo, cv2.COLOR_BGR2RGB))
plt.axis('off')
plt.title('Original')

plt.subplot(1, 2, 2)
plt.imshow(cv2.cvtColor(old_photo_denoised, cv2.COLOR_BGR2RGB))
plt.axis('off')
plt.title('Fine-Grain Noise Removed Image')
plt.show()

"""#Task 3. Sharpen the faces and objects while keeping natural textures.

![image.png](data:image/png;base64,)
"""

blurred = cv2.GaussianBlur(old_photo, (5,5), 0)  # Blur the image
unsharp_mask = cv2.subtract(old_photo, blurred)  # Subtract blurred from original
old_photo_sharpened = cv2.addWeighted(old_photo, 1.5, unsharp_mask, -0.5, 0)

# Display the results
plt.subplot(1, 2, 1)
plt.imshow(cv2.cvtColor(old_photo, cv2.COLOR_BGR2RGB))
plt.axis('off')
plt.title('Original')

plt.subplot(1, 2, 2)
plt.imshow(cv2.cvtColor(old_photo_sharpened, cv2.COLOR_BGR2RGB))
plt.axis('off')
plt.title('Sharpened Image')
plt.show()

"""# Without Subtraction of Blurred image from Original One"""

blurred = cv2.GaussianBlur(old_photo, (5,5), 0)
sharpened = cv2.addWeighted(old_photo, 1.5, blurred, -0.5, 0)


plt.subplot(1, 2, 1)
plt.imshow(cv2.cvtColor(blurred, cv2.COLOR_BGR2RGB))
plt.axis('off')
plt.title('Blurred')

plt.subplot(1, 2, 2)
plt.imshow(cv2.cvtColor(sharpened, cv2.COLOR_BGR2RGB))
plt.axis('off')
plt.title('Sharpened Image')
plt.show()

"""![image.png](data:image/png;base64,)"""

# Load the fingerprint image
image = cv2.imread('Scanerio 04 (1).png', cv2.IMREAD_GRAYSCALE)
plt.imshow(image, cmap='gray')

"""# Task 1: Remove noise and small smudges while preserving fingerprint ridges

"""

# Use Bilateral Filtering to smooth the image while preserving edges
smoothed_image = cv2.bilateralFilter(image, d=9, sigmaColor=75, sigmaSpace=75)

plt.subplot(1, 2, 1)
plt.imshow(cv2.cvtColor(image, cv2.COLOR_BGR2RGB))
plt.axis('off')
plt.title('Blurred')

plt.subplot(1, 2, 2)
plt.imshow(cv2.cvtColor(smoothed_image, cv2.COLOR_BGR2RGB))
plt.axis('off')
plt.title('Denoised Image')
plt.show()

"""# Task 2: Smooth out unwanted variations and improve contrast

![image.png](data:image/png;base64,)
"""

# Use Histogram Equalization to enhance contrast
contrast_enhanced_image = cv2.equalizeHist(image)


plt.subplot(1, 2, 1)
plt.imshow(cv2.cvtColor(image, cv2.COLOR_BGR2RGB))
plt.axis('off')
plt.title('Blurred')

plt.subplot(1, 2, 2)
plt.imshow(cv2.cvtColor(contrast_enhanced_image, cv2.COLOR_BGR2RGB))
plt.axis('off')
plt.title('Contrast Enhanced Image')
plt.show()

"""# Task 3: Enhance the ridge patterns, making feature extraction easier for recognition

![image.png](data:image/png;base64,)

![image.png](data:image/png;base64,)

![image.png](data:image/png;base64,)
"""

laplacian=cv2.Laplacian(image,cv2.CV_64F,ksize=11)

plt.subplot(1,2,1)
plt.imshow(image,cmap='gray')
plt.title('Original Image')
plt.axis('off')

plt.subplot(1,2,2)
plt.imshow(laplacian,cmap='gray')
plt.title('Laplacian Result')
plt.axis('off')
plt.show()

